INSERT INTO `catalog` (`id`, `name`, `type`, `price`, `description`, `link`, `imgpath`) VALUES
(0, 'ASUS GeForce GTX 1060 6GB Dual-Fan OC Edition VR Ready Dual HDMI DP 1.4 Gaming Graphics Card (DUAL-GTX1060-O6G)', 'Graphics card', 296, 'Powered by NVIDIA Pascal, the ASUS Dual-fan GTX 1060 delivers cool overclocked performance with a 1809MHz Boost Clock and patented wing-blade fans shrouded in white to match a variety of ASUS Signature Series Motherboards.', 'https://www.amazon.com/GeForce-Dual-Fan-Gaming-Graphics-DUAL-GTX1060-O6G/dp/B01JHQT1SE/ref=sr_1_4?s=pc&ie=UTF8&qid=1543469337&sr=1-4&keywords=graphics+card', 'images/51T1GaSIVLL.jpg'),
(1, 'EVGA GeForce GTX 1050 Ti Gaming, 4GB GDDR5, DX12 OSD Support (PXOC) Graphics Card 04G-P4-6251-KR', 'Graphics card', 170, 'The EVGA GeForce GTX 1050 Ti hits the perfect spot for that upgrade you know you need, but at the price you want! With the latest NVIDIA Pascal architecture, the 4GB GTX 1050 Ti displays stunning visuals and great performance at 1080p HD+.', 'https://www.amazon.com/EVGA-GeForce-Support-Graphics-04G-P4-6251-KR/dp/B01MEFABEL/ref=sr_1_5?s=pc&ie=UTF8&qid=1543469337&sr=1-5&keywords=graphics+card', 'images/04G-P4-6251-KR_LG_1.png'),
(2, 'Gigabyte Geforce GTX 1050 2GB GDDR5 128 Bit PCI-E Graphic Card (GV-N1050OC-2GD)', 'Graphics card', 130, 'This GIGABYTE Geforce GTX 1050 2GB OC graphic card is made for the gaming enthusiasts. Equipped with one of the advanced architecture, get ready to play some of the most graphic intensive games in HD quality.', 'https://www.amazon.com/Gigabyte-Geforce-GDDR5-Graphic-GV-N1050OC-2GD/dp/B01MG0733A/ref=sr_1_6?s=pc&ie=UTF8&qid=1543469337&sr=1-6&keywords=graphics+card', 'images/gigabyte1050.jpg'),
(3, 'MSI Gaming GeForce GTX 1050 Ti 4GB GDRR5 128-bit HDCP Support DirectX 12 TORX 2.0 Fan Graphics Card (GTX 1050 TI Gaming X 4G)', 'Graphics card', 180, 'Pascal is built to meet the demands of next generation displays, including ultra-high-resolution and multiple monitors. It features NVIDIA GameWorks technologies for extremely smooth gameplay and cinematic experiences. Plus, it includes revolutionary new ', 'https://www.amazon.com/MSI-GeForce-GTX-1050-TI/dp/B01MA62JSZ/ref=sr_1_7?s=pc&ie=UTF8&qid=1543469337&sr=1-7&keywords=graphics+card', 'images/81VBPk5pnLL._SL1500_.jpg'),
(4, 'EVGA GeForce GTX 1070 SC GAMING ACX 3.0 Black Edition, 8GB GDDR5, LED, DX12 OSD Support (PXOC) 08G-P4-5173-KR', 'Graphics card', 446, 'NVIDIA\'s flagship GeForce GTX 1070 is powered by NVIDIA Pascal architecture. It comes with ultra-fast FinFET and high bandwidth GDDR5 technologies, plus support for DirectX 12 features to deliver, fast, smooth and power-efficient gaming experiences.', 'https://www.amazon.com/EVGA-GeForce-GAMING-Support-08G-P4-5173-KR/dp/B01KVZBNY0/ref=sr_1_8?s=pc&ie=UTF8&qid=1543469337&sr=1-8&keywords=graphics+card', 'images/71OTfw9Bv5L._SL1200_.jpg'),
(5, 'EVGA GeForce GTX 1060 3GB GAMING, ACX 2.0 (Single Fan), 3GB GDDR5, DX12 OSD Support (PXOC) Graphics Cards 03G-P4-6160-KR', 'Graphics card', 180, 'The EVGA GeForce GTX 1060 is loaded with innovative new gaming technologies, making it the perfect choice for the latest high definition games. Powered by NVIDIA Pascal the most advanced GPU architecture ever created the GeForce GTX 1060 delivers brillian', 'https://www.amazon.com/d/Computer-Graphics-Cards/EVGA-GeForce-Support-Graphics-03G-P4-6160-KR/B01KUADE3O/ref=sr_1_9?s=pc&ie=UTF8&qid=1543469337&sr=1-9&keywords=graphics+card', 'images/71sZs+2W65L._SL1200_.jpg'),
(6, 'MSI Gaming GeForce GT 710 2GB GDRR3 64-bit HDCP Support DirectX 12 OpenGL 4.5 Single Fan Low Profile Graphics Card (GT 710 2GD3 LP)', 'Graphics card', 46, 'MSI NVIDIA GeForce GT 710 2GB DDR3 VGA/DVI/HDMI Low Profile PCI-Express Video Card specifications: Mfr Part Number: GT 710 2GD3 LP. Chipset: NVIDIA GeForce GT 710.', 'https://www.amazon.com/MSI-GT-710-2GD3-LP/dp/B01DOFD0G8/ref=sr_1_10?s=pc&ie=UTF8&qid=1543469337&sr=1-10&keywords=graphics+card', 'images/71ucbX1fTUL._SL1155_.jpg'),
(7, 'XFX Radeon RX 580 GTS XXX Edition 1386MHz OC+, 8GB GDDR5, VR Ready, Dual BIOS, 3xDP HDMI DVI, AMD Graphics Card (RX-580P8DFD6)', 'Graphics card', 267, 'XFX Radeon RX 580 GTS XXX Edition 1386MHz OC+, 8GB GDDR5, VR Ready, Dual BIOS, 3xDP HDMI DVI, AMD Graphics Card (RX-580P8DFD6) ', 'https://www.amazon.com/XFX-Radeon-1386MHz-Graphics-RX-580P8DFD6/dp/B06Y66K3XD/ref=sr_1_11?s=pc&ie=UTF8&qid=1543469337&sr=1-11&keywords=graphics+card', 'images/81D46VNLb9L._SL1500_.jpg'),
(8, 'PNY NVIDIA GeForce GTX 1060 6GB XLR8 Gaming Overclocked Graphics Card VCGGTX10606XGPB-OC2', 'Graphics card', 240, 'The GeForce GTX 1060 graphics card is loaded with innovative new gaming technologies, making it the perfect choice for the latest high-definition games. Powered by NVIDIA Pascal - the most advanced GPU architecture ever created-the GeForce GTX 1060 delive', 'https://www.amazon.com/PNY-GeForce-Overclocked-Graphics-VCGGTX10606XGPB-OC2/dp/B0792SPV7Q/ref=sr_1_12?s=pc&ie=UTF8&qid=1543469337&sr=1-12&keywords=graphics+card', 'images/61bxRSq0V8L._SL1000_.jpg'),
(9, 'Gigabyte AORUS Radeon RX 580 8GB Graphic Cards GV-RX580AORUS-8GD', 'Graphics card', 300, 'Powered by Radeon RX 580 and integrated with 8GB GDDR5 256-bit memory interface. Featuring WINDFORCE 2X with Blade Fan Design', 'https://www.amazon.com/Gigabyte-AORUS-Radeon-Graphic-GV-RX580AORUS-8GD/dp/B06Y46X4L9/ref=sr_1_13?s=pc&ie=UTF8&qid=1543469337&sr=1-13&keywords=graphics+card', 'images/61qRc43ZgzL._SL1151_.jpg'),
(10, 'Gigabyte GV-N1030OC-2GI Nvidia GeForce GT 1030 OC 2G Graphics Card', 'Graphics card', 85, 'Powered by GeForce GT 1030 and integrated with 2GB GDDR5 64-bit memory interface. Supports HDMI 4Kat60Hz Smooth 4K video playback and HTML5 web browsing.', 'https://www.amazon.com/Gigabyte-GV-N1030OC-2GI-Nvidia-GeForce-Graphics/dp/B07646VQ6T/ref=sr_1_14?s=pc&ie=UTF8&qid=1543469337&sr=1-14&keywords=graphics+card', 'images/919lkVdI+bL._SL1500_.jpg'),
(11, 'EVGA GeForce GTX 1070 Ti GAMING, 8GB GDDR5, EVGA OCX Scanner OC, White LED, DX12OSD Support (PXOC) Graphics Card 08G-P4-5670-KR', 'Graphics card', 430, 'Take on today\'s most challenging, graphics-intensive games without missing a beat. The EVGA GeForce GTX1070 Ti delivers the incredible speed and power of NVIDIA Pascal - the most advanced gaming GPU architecture ever created.', 'https://www.amazon.com/EVGA-GeForce-Scanner-Graphics-08G-P4-5670-KR/dp/B076S558ZZ/ref=sr_1_17?s=pc&ie=UTF8&qid=1543469337&sr=1-17&keywords=graphics+card', 'images/71ujcSTlMxL._SL1200_.jpg'),
(12, 'ASUS Cerberus GeForce GTX 1050 Ti 4GB OC Edition GDDR5 Gaming Graphics Card (Cerberus-GTX1050Ti-O4G)', 'Graphics card', 200, 'Play longer and cooler than the reference to the ASUS Cerberus GTX 1050 Ti 4GB OC edition, powered by NVIDIA. GPU Tweak II enables one-click overclocking to optimize graphics performance while Auto-extreme Technology uses full machine SMT automation with ', 'https://www.amazon.com/Cerberus-GeForce-Gaming-Graphics-Cerberus-GTX1050Ti-O4G/dp/B079JSKCW3/ref=sr_1_18?s=pc&ie=UTF8&qid=1543469337&sr=1-18&keywords=graphics+card', 'images/91sPs0ELPnL._SL1500_.jpg'),
(13, 'EVGA GeForce RTX 2070 XC Gaming, 8GB GDDR6, Dual HDB Fans & RGB LED Graphics Card 08G-P4-2172-KR', 'Graphics card', 530, 'The EVGA GeForce RTX 20-Series Graphics Cards are powered by the all-new NVIDIA Turing architecture to give you incredible new levels of gaming realism, speed, power efficiency, and immersion.', 'https://www.amazon.com/EVGA-RTX-2070-XC-08G-P4-2172-KR/dp/B07J63W42X/ref=sr_1_19?s=pc&ie=UTF8&qid=1543469337&sr=1-19&keywords=graphics+card', 'images/81b3fETbLlL._SL1500_.jpg'),
(14, 'EVGA GeForce GTX 1080 SC GAMING ACX 3.0, 8GB GDDR5X, LED, DX12 OSD Support (PXOC) Graphics Card 08G-P4-6183-KR', 'Graphics card', 500, 'The EVGA GeForce GTX 1080 featuring EVGA ACX 3.0 cooling has arrived. This new graphics card features NVIDIA\'s new \"Pascal\" graphics processor which is the most advanced gaming GPU ever created.', 'https://www.amazon.com/EVGA-GeForce-Support-Graphics-08G-P4-6183-KR/dp/B01GAI6478/ref=sr_1_20?s=pc&ie=UTF8&qid=1543469337&sr=1-20&keywords=graphics+card', 'images/71c0Kal5H-L._SL1200_.jpg'),
(15, 'MSI Gaming Radeon RX 580 256-bit 8GB GDRR5 DirectX 12 VR Ready CFX Graphics Card (RX 580 ARMOR MK2 8G OC)', 'Graphics card', 300, 'Features: TORX 2.0 FAN: Supremely silent Dispersion fan blade: Steeper curved blade accelerating the airflow. Traditional fan blade: Provides steady airflow to massive heat sink below.', 'https://www.amazon.com/MSI-RX-580-ARMOR-MK2/dp/B079NX4GCF/ref=sr_1_21?s=pc&ie=UTF8&qid=1543469337&sr=1-21&keywords=graphics+card', 'images/71mAY7mL6SL._SL1024_.jpg'),
(16, 'ASUS ROG-STRIX-RX580-O8G-GAMINGOC Edition GDDR5 DP HDMI DVI VR Ready AMD Graphics Card', 'Graphics card', 230, 'The VR rebellion continues with the ROG Strix RX 580 O8G Gaming graphics card. Outshine the competition with ASUS Aura Sync RGB lighting while the industry-first MaxContact technology provides improved thermal transfer with twice the GPU contact. GPU Twea', 'https://www.amazon.com/ASUS-ROG-STRIX-RX580-O8G-GAMINGOC-GDDR5-Ready-Graphics/dp/B071D8YQJD/ref=sr_1_22?s=pc&ie=UTF8&qid=1543469337&sr=1-22&keywords=graphics+card', 'images/91q5KBUBiaL._SL1500_.jpg'),
(17, 'MSI GAMING GeForce GTX 1060 6GB GDRR5 192-bit HDCP Support DirectX 12 Dual TORX 2.0 Fan VR Ready Graphics Card (GTX 1060 GAMING X 6G)', 'Graphics card', 280, 'MSI GAMING GeForce GTX 1060 6GB GDDR5 DirectX 12 VR Ready (GeForce GTX 1060 GAMING X 6G)', 'https://www.amazon.com/MSI-GAMING-GTX-1060-6G/dp/B01IEKYD5U/ref=sr_1_23?s=pc&ie=UTF8&qid=1543469337&sr=1-23&keywords=graphics+card', 'images/71l-y4+ZQaL._SL1280_.jpg'),
