(19, 'MSI Gaming GeForce GTX 1080 8GB GDDR5X SLI DirectX 12 VR Ready Graphics Card (GTX 1080 GAMING X 8G)', 'Graphics card', 500, 'MSI NVIDIA GeForce GTX 1080 8GB GDDR5X DVI/HDMI/3DisplayPort PCI-Express video card.', 'https://www.amazon.com/MSI-GTX-1080-GAMING-8G/dp/B01GLYD7MG/ref=sr_1_25?s=pc&ie=UTF8&qid=1543469337&sr=1-25&keywords=graphics+card', 'images/51Avu5iodlL.jpg'),
(20, 'MSI ATI Radeon HD6450 1 GB DDR3 VGA/DVI/HDMI Low Profile PCI-Express Video Card R6450-MD1GD3/LP', 'Graphics card', 40, 'MSI ATI Radeon HD6450 1GB DDR3 VGA/DVI/HDMI Low Profile PCI-Express Video Card', 'https://www.amazon.com/MSI-Profile-PCI-Express-R6450-MD1GD3-LP/dp/B004X6ABTM/ref=sr_1_26?s=pc&ie=UTF8&qid=1543469337&sr=1-26&keywords=graphics+card', 'images/51YT8wAQeUL.jpg'),
(21, 'ZOTAC GeForce GTX 1050 Ti Mini, 4GB GDDR5 DisplayPort 128-bit Gaming Graphic Card (ZT-P10510A-10L)', 'Graphics card', 170, 'TURN YOUR PC INTO A TRUE GAMING RIG WITH THE FAST, POWERFUL GEFORCE GTX 1050 Ti. It‘s powered by NVIDIA Pascal - the most advanced GPU architecture ever created - and features innovative NVIDIA technologies to drive the latest games in their full glory in', 'https://www.amazon.com/d/Computer-Graphics-Cards/ZOTAC-GeForce-DisplayPort-128-bit-ZT-P10510A-10L/B01MCU1ERO/ref=sr_1_27?s=pc&ie=UTF8&qid=1543469337&sr=1-27&keywords=graphics+card', 'images/61mMBYSZ6fL._SL1112_.jpg'),
(22, 'EVGA GeForce GTX 1080 Ti FTW3 DT Gaming 11GB GDDR5X iCX Technology - 9 Thermal Sensors & RGB LED G/P/M Graphic Cards (11G-P4-6694-KR)', 'Graphics card', 700, 'Featuring a total of 11 global patents (pending and granted), is from EVGA is efficiency perfected. With 9 additional sensors embedded on the PCB, a newly designed die-cast baseplate and back plate, purposefully directed airflow chambers, and full control', 'https://www.amazon.com/EVGA-GeForce-Gaming-GDDR5X-Technology/dp/B0762Q49NV/ref=sr_1_27?s=pc&ie=UTF8&qid=1543469413&sr=1-27&keywords=graphics+card', 'images/71I+CdSp1NL._SL1200_.jpg'),
(23, 'EVGA GeForce 210 1024 MB DDR3 PCI Express 2.0 DVI/HDMI/VGA Graphics Card, 01G-P3-1312-LR', 'Graphics card', 30, 'Ge Force 210,1024 MB,DDR3,PCI-E 2.0,1 DVI Ports,HDTV support,4.8 GB/sec,Memory Clock 600 MHz', 'https://www.amazon.com/EVGA-GeForce-Express-Graphics-01G-P3-1312-LR/dp/B00498305G/ref=sr_1_28?s=pc&ie=UTF8&qid=1543469413&sr=1-28&keywords=graphics+card', 'images/51LByACGzpL.jpg'),
(24, 'EVGA GeForce GT 730 4GB DDR3 128bit Dual DVI mHDMI Graphics Cards 04G-P3-2739-KR', 'Graphics card', 78, 'Speed up your PC experience when you upgrade from integrated graphics to the new NVIDIA GeForce GT 730 dedicated card. Enjoy all your videos and pictures at HD resolutions, with faster video editing, faster photo editing, and faster web browsing compared ', 'https://www.amazon.com/EVGA-GeForce-128bit-Graphics-04G-P3-2739-KR/dp/B01AWB7WMU/ref=sr_1_29?s=pc&ie=UTF8&qid=1543469413&sr=1-29&keywords=graphics+card', 'images/71BlkcHq+1L._SL1200_.jpg'),
(25, 'EVGA GeForce GT 1030 SC 2GB GDDR5 Low Profile Graphic Cards 02G-P4-6333-KR', 'Graphics card', 70, 'Accelerate your entire PC experience with the fast, powerful EVGA GeForce gt 1030 graphics card. Its award-winning NVIDIA Pascal architecture, powerful graphics engine, and state-of-the-art technologies give you the performance upgrade you need to drive t', 'https://www.amazon.com/EVGA-GeForce-Profile-Graphic-02G-P4-6333-KR/dp/B071LGVBDM/ref=sr_1_30?s=pc&ie=UTF8&qid=1543469413&sr=1-30&keywords=graphics+card', 'images/71oQKP2gD6L._SL1200_.jpg'),
(26, 'GIGABYTE GeForce GT 1030 GV-N1030D5-2GL Low Profile 2G Computer Graphics Card', 'Graphics card', 80, 'Powered by GeForce GT 1030 and integrated with 2GB GDDR5 64-bit memory interface. Featuring Low profile design with 150 mm card length.', 'https://www.amazon.com/GIGABYTE-GeForce-GV-N1030D5-2GL-Computer-Graphics/dp/B071DY2VJR/ref=sr_1_29?s=pc&ie=UTF8&qid=1543469413&sr=1-29&keywords=graphics+card', 'images/719DzOujdQL._SL1331_.jpg'),
(27, 'Gigabyte GeForce GTX 1060 WINDFORCE OC 6G (GV-N1060WF2OC-6GD)', 'Graphics card', 260, 'Powered by GeForce GTX 1060 and integrated with 6GB GDDR5 192bit memory. Tip:Make sure all connections are properly connected and can find the customer service contact in user manual for further assistance', 'https://www.amazon.com/Gigabyte-GeForce-1060-WINDFORCE-GV-N1060WF2OC-6GD/dp/B01JNUO6BG/ref=sr_1_30?s=pc&ie=UTF8&qid=1543469413&sr=1-30&keywords=graphics+card', 'images/71KsHefN6VL._SL1500_.jpg'),
(28, 'MSI Gaming GeForce GTX 1070 8GB GDDR5 SLI DirectX 12 VR Ready Graphics Card (GTX 1070 ARMOR 8G OC)', 'Graphics card', 420, 'Dressed in a fashionable Black & white design inspired by advanced Armor shielding, the MSI GEFORCE GTX 1070 ARMOR 8G OC is perfect for gamers and case modders looking for something unique and different.', 'https://www.amazon.com/MSI-GTX-1070-ARMOR-8G/dp/B01GXOX2BU/ref=sr_1_31?s=pc&ie=UTF8&qid=1543469413&sr=1-31&keywords=graphics+card', 'images/71hvEzTkCWL._SL1100_.jpg'),
