(30, 'Gigabyte Radeon RX 560 Gaming OC 4G REv2.0 (GV-RX560GAMING OC-4GD REV2.0)', 'Graphics card', 145, 'Powered by Radeon RX 560 and integrated with 4GB GDDR5 128-bit memory interface. Featuring WINDFORCE 2X with Blade Fan Design.', 'https://www.amazon.com/Gigabyte-Radeon-Gaming-REv2-0-GV-RX560GAMING/dp/B0762PP97W/ref=sr_1_33?s=pc&ie=UTF8&qid=1543469413&sr=1-33&keywords=graphics+card', 'images/91A1pIE5DQL._SL1500_.jpg'),
(31, 'ASUS ROG Strix Radeon RX 560 16CU 4GB Gaming GDDR5 DP HDMI DVI AMD Graphics Card (ROG-STRIX-RX560-4G-GAMING)', 'Graphics card', 140, 'Outshine the competition with the ASUS Aura Sync RGB capable ROG Strix RX 560 4GB gaming graphics card, built with Auto-extreme manufacturing technology for quality.', 'https://www.amazon.com/Strix-Radeon-Gaming-Graphics-ROG-STRIX-RX560-4G-GAMING/dp/B0716ZH99H/ref=sr_1_47?s=pc&ie=UTF8&qid=1543469413&sr=1-47&keywords=graphics+card', 'images/91eqRXt1ZeL._SL1500_.jpg'),
(32, 'ASUS GeForce GTX 1080 TI 11GB Turbo Edition VR Ready 5K HD Gaming HDMI DisplayPort PC GDDR5X Graphics Card TURBO-GTX1080TI-11G', 'Graphics card', 700, 'Powered by NVIDIA Pascal, the ASUS GeForce GTX 1080TI Turbo Edition features the world\'s fastest gaming GPU, delivering jaw-dropping 5K HD gaming experiences with 11GB GDDR5X memory and 1582 MHz boost clock. Take your system\'s performance to the next leve', 'https://www.amazon.com/GeForce-Gaming-DisplayPort-Graphics-TURBO-GTX1080TI-11G/dp/B06Y31FYWY/ref=sr_1_34?s=pc&ie=UTF8&qid=1543469413&sr=1-34&keywords=graphics+card', 'images/91am+EJjS9L._SL1500_.jpg'),
(33, 'ASUS PH-GT1030-O2G GeForce GT 1030 2GB Phoenix Fan OC Edition HDMI DVI Graphics Card', 'Graphics card', 89, 'he ASUS GeForce GT 1030 Phoenix OC edition features a dual-ball bearing fan for superior airflow and 2X lifespan over reference. Auto-extreme manufacturing technology with Super Alloy Power II delivers premium quality and reliability.', 'https://www.amazon.com/ASUS-PH-GT1030-O2G-GeForce-Phoenix-Graphics/dp/B071JV26GH/ref=sr_1_35?s=pc&ie=UTF8&qid=1543469413&sr=1-35&keywords=graphics+card', 'images/91FkyTi-vIL._SL1500_.jpg'),
