(35, 'ZOTAC GeForce GT 730 Zone Edition 4GB DDR3 PCI Express 2.0 x16 (x8 lanes) Graphics Card (ZT-71115-20L)', 'Graphics card', 80, 'Upgrade to dedicated graphics and memory for unmatched high-definition visuals and performance with the ZOTAC GeForce GT 730. Hardware accelerated Blu-ray 3D playback enables the ZOTAC GeForce GT 730 to render stunning stereoscopic high-definition video w', 'https://www.amazon.com/ZOTAC-GeForce-Express-Graphics-ZT-71115-20L/dp/B00R5UW038/ref=sr_1_40?s=pc&ie=UTF8&qid=1543469413&sr=1-40&keywords=graphics+card', 'images/81B4f41wzZL._SL1500_.jpg'),
(36, 'Sapphire 11265-07-20G Radeon Nitro+ RX 580 4GB GDDR5 Dual HDMI / DVI-D / Dual DP with Backplate (UEFI) PCI-E Graphics Card', 'Graphics card', 201, 'Sapphire Radeon NITRO+ RX 580 4GB GDDR5 DUAL HDMI/DVI-D/DUAL DP w/backplate (UEFI) PCI-E Graphics Card.', 'https://www.amazon.com/Sapphire-11265-07-20G-Radeon-Backplate-Graphics/dp/B06ZZGXTTK/ref=sr_1_41?s=pc&ie=UTF8&qid=1543469413&sr=1-41&keywords=graphics+card', 'images/81hyMijvwRL._SL1500_.jpg'),
(37, 'ZOTAC GeForce GTX 1060 Mini, ZT-P10600A-10L, 6GB GDDR5 VR Ready Super Compact Gaming Graphics Card', 'Graphics card', 230, 'The GeForce GTX 1060 graphics card is loaded with innovative new gaming technologies and the groundbreaking NVIVIDIA Pascal architecture, making it the perfect choice for high-definition gaming in one of the smallest sizes at only 6.85” length.', 'https://www.amazon.com/ZOTAC-GeForce-ZT-P10600A-10L-Compact-Graphics/dp/B01IA9FEOO/ref=sr_1_42?s=pc&ie=UTF8&qid=1543469413&sr=1-42&keywords=graphics+card', 'images/81zMVqg3alL._SL1500_.jpg'),
(38, 'ASUS ROG Strix GeForce GTX 1070 Ti 8GB GDDR5 Advanced Edition VR Ready DP HDMI DVI Gaming Graphics Card (ROG-STRIX-GTX1070TI-A8G-GAMING)', 'Graphics card', 576, 'Powered by NVIDIA Pascal, the ROG Strix GTX 1070 Ti delivers raw power unleashed featuring a 1759 MHz boost clock. MaxContact technology delivers increased cooling efficiency while Auto-extreme manufacturing with aerospace-grade Super Alloy II components ', 'https://www.amazon.com/GeForce-Advanced-Gaming-Graphics-ROG-STRIX-GTX1070TI-A8G-GAMING/dp/B076RCTXGX/ref=sr_1_45?s=pc&ie=UTF8&qid=1543469413&sr=1-45&keywords=graphics+card', 'images/915voJ1XLHL._SL1500_.jpg'),
(39, 'ASUS Radeon RX 560 14CU 4GB EVO OC Edition GDDR5 DP HDMI DVI AMD Graphics Card (RX560-O4G-EVO)', 'Graphics card', 170, 'Based on AMD\'s Polaris architecture, the ASUS Radeon RX 560 4GB OC edition graphics card features a dual-fan design for improved airflow and quieter performance. Easily monitor and control GPU cooling with the intuitive GPU Tweak II. Auto-extreme manufact', 'https://www.amazon.com/ASUS-Radeon-GDDR5-Graphics-RX560-O4G-EVO/dp/B076FL47B7/ref=sr_1_46?s=pc&ie=UTF8&qid=1543469413&sr=1-46&keywords=graphics+card', 'images/91wKu0FQiRL._SL1500_.jpg'),
