(59, 'Cooler Master Hyper 212 Evo (RR-212E-20PK-R2) CPU Cooler with PWM Fan, Four Direct Contact Heat Pipes', 'cooler', 27, 'Cooler Master, an industry leading chassis, thermal solution, peripheral, and accessory manufacturer, signals the rebirth of a household name in computing, the Hyper 212 EVO CPU Cooler.', 'https://www.amazon.com/Cooler-Master-RR-212E-20PK-R2-Direct-Contact/dp/B005O65JXI/ref=sr_1_4?s=pc&ie=UTF8&qid=1543478302&sr=1-4&keywords=cpu+cooler', 'images/81c-RAt5Y9L._SL1500_.jpg'),
