(61, 'ORSAIR HYDRO Series H100i PRO RGB AIO Liquid CPU Cooler, 240mm Radiator, Dual 120mm ML Series PWM Fans', 'cooler', 100, 'The CORSAIR Hydro Series H100i PRO is an all-in-one RGB liquid CPU cooler with a 240mm radiator built for low-noise cooling performance and bold styling with an RGB LED pump head.', 'https://www.amazon.com/Radiator-Advanced-Lighting-Software-compatible/dp/B07BWNWQKJ/ref=sr_1_6?s=pc&ie=UTF8&qid=1543478302&sr=1-6&keywords=cpu+cooler', 'images/71UUKDJ1wsL._SL1500_.jpg'),
