(63, 'Cooler Master MasterLiquid LC240E RGB All-in-one CPU Liquid Cooler with Dual Chamber Pump Latest Intel/AMD Support (MLA-D24M-A18PC-R1)', 'cooler', 50, 'The LC240E RGB incorporates Cooler Master\'s Dual Chamber Pump, 120mm Fan, and RGB Controller to control the lighting effects. With its matt-black styling, braided cabling and RGB lighting effects, the LC240E RGB is a Cooler Master original design and enab', 'https://www.amazon.com/Cooler-Master-MasterLiquid-Chamber-MLA-D24M-A18PC-R1/dp/B07CRGC899/ref=sr_1_8?s=pc&ie=UTF8&qid=1543478302&sr=1-8&keywords=cpu+cooler', 'images/81UMU8POoOL._SL1500_.jpg'),
