(65, 'CORSAIR Hydro Series H100i v2 AIO Liquid CPU Cooler, 240mm Radiator, Dual 120mm PWM Fans, Advanced RGB Lighting and Fan Software Control', 'cooler', 100, 'The Hydro Series H100i v2 is an extreme performance, all-in-one liquid CPU cooler for cases with 240mm radiator mounts. The 240mm radiator and dual SP120L PWM fans provide the excellent heat dissipation you need for highly overclocked CPUs. ', 'https://www.amazon.com/CORSAIR-Radiator-Advanced-Lighting-Software/dp/B019EXSSBG/ref=sr_1_10?s=pc&ie=UTF8&qid=1543478302&sr=1-10&keywords=cpu+cooler', 'images/51Q4HeS37YL._SL1200_.jpg'),
