(68, 'Cooler Master RR-212L-16PR-R1 Hyper 212 LED CPU Cooler with PWM Fan, Four Direct Contact Heat Pipes, Unique Blade Design and Red LEDs', 'cooler', 28, 'The Hyper 212 LED is equipped with a PWM red LED fan that provides the excellent airflow and static pressure to take the heat away. Four direct Contact heat pipes with funnel shaped aluminum fins provide the optimized heat dissipation. An improved univers', 'https://www.amazon.com/Cooler-Master-RR-212L-16PR-R1-Direct-Contact/dp/B01KBXKP8W/ref=sr_1_13?s=pc&ie=UTF8&qid=1543478302&sr=1-13&keywords=cpu+cooler', 'images/81WN7UjlKgL._SL1500_.jpg'),
(69, 'DEEPCOOL GAMMAXX 400 CPU Air Cooler with 4 Heatpipes, 120mm PWM Fan and Blue LED for Intel/AMD CPUs(AM4 Compatible)', 'cooler', 25, 'Based on 4 copper direct contact heatpipes and striking blue LED lighting, DEEPCOOL GAMMAXX 400 includes a PWM controlled  fan and delivers a maximum of 74.34 CFM volume air flow with low noise and turbulence, becoming one of the most popular CPU cooling ', 'https://www.amazon.com/DEEPCOOL-GAMMAXX-400-Blue-Compatible/dp/B00JQ2YDCY/ref=sr_1_14?s=pc&ie=UTF8&qid=1543478302&sr=1-14&keywords=cpu+cooler', 'images/71dLgdM2PgL._SL1088_.jpg'),
